import LaptopImg from "../images/computer-1185626_1280.jpg";

const RegisterAd = () => {
  return (
    <div className="register-ad-container ml-20 mt-8 text-slate-50 bg-amber-600 rounded-lg flex">
      <div className="take-back-section ml-2 pt-2">
        <h1 className="font-serif font-bold text-4xl mt-2">
          Take Back What's Yours
        </h1>
        <p>
          File your taxes with us today by scheduling a session with one of our
          tax professionals.
        </p>
        <button>
          Register <strong>Now</strong>
        </button>
      </div>
      <div className="laptop-img-container">
        <img width="400px" src={LaptopImg} alt="img" />
      </div>
    </div>
  );
};
export default RegisterAd;
